855: public void testInvalidTableContents() throws IOException {
856: File in = ParseTest.getFile("/htmltests/table-invalid-elements.html");
857: Document doc = Jsoup.parse(in, "UTF-8");
858: doc.outputSettings().prettyPrint(true);
859: String rendered = doc.toString();
860: int endOfEmail = rendered.indexOf("Comment");
861: int guarantee = rendered.indexOf("Why am I here?");
862: assertTrue("Comment not found", endOfEmail > -1);
863: assertTrue("Search text not found", guarantee > -1);
864: assertTrue("Search text did not come after comment", guarantee > endOfEmail);
865: }

